prompt: "Q: Write python code to solve the following coding problem that obeys the\
  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nFind the symmetric\
  \ difference of two sets $A = \\\\{a_0, a_1, ..., a_{n-1}\\\\}$ and $B = \\\\{b_0,\
  \ b_1, ..., b_{m-1}\\\\}$.\n\nConstraints\n\n* $1 \\leq n, m \\leq 200,000$\n* $0\
  \ \\leq a_0 < a_1 < ... < a_{n-1} \\leq 10^9$\n* $0 \\leq b_0 < b_1 < ... < b_{m-1}\
  \ \\leq 10^9$\n\nInput\n\nThe input is given in the following format.\n\n\n$n$\n\
  $a_0 \\; a_1 \\; ... \\; a_{n-1}$\n$m$\n$b_0 \\; b_1 \\; ... \\; b_{m-1}$\n\n\n\
  Elements in $A$ and $B$ are given in ascending order. There are no duplicate elements\
  \ in each set.\n\nOutput\n\nPrint elements in the symmetric difference in ascending\
  \ order. Print an element in a line.\n\nExample\n\nInput\n\n7\n1 2 3 4 5 6 7\n4\n\
  2 4 6 8\n\n\nOutput\n\n1\n3\n5\n7\n8\nA: ```n = int(input())\na = set(map(int, input().split()))\n\
  m = int(input())\nb = set(map(int, input().split()))\ns_union = a | b\ns_intersection\
  \ = a & b\nans = s_union - s_intersection\nif ans:\n    print(*sorted(ans), sep=\"\
  \\n\")```\nQ: Write python code to solve the following coding problem that obeys\
  \ the constraints and passes the example test cases. The output code needs to read\
  \ from and write to standard IO. Please wrap your code answer using ```:\nYou are\
  \ given a permutation p_1, p_2, ..., p_n. A permutation of length n is a sequence\
  \ such that each integer between 1 and n occurs exactly once in the sequence.\n\n\
  Find the number of pairs of indices (l, r) (1 \u2264 l \u2264 r \u2264 n) such that\
  \ the value of the median of p_l, p_{l+1}, ..., p_r is exactly the given number\
  \ m.\n\nThe median of a sequence is the value of the element which is in the middle\
  \ of the sequence after sorting it in non-decreasing order. If the length of the\
  \ sequence is even, the left of two middle elements is used.\n\nFor example, if\
  \ a=[4, 2, 7, 5] then its median is 4 since after sorting the sequence, it will\
  \ look like [2, 4, 5, 7] and the left of two middle elements is equal to 4. The\
  \ median of [7, 1, 2, 9, 6] equals 6 since after sorting, the value 6 will be in\
  \ the middle of the sequence.\n\nWrite a program to find the number of pairs of\
  \ indices (l, r) (1 \u2264 l \u2264 r \u2264 n) such that the value of the median\
  \ of p_l, p_{l+1}, ..., p_r is exactly the given number m.\n\nInput\n\nThe first\
  \ line contains integers n and m (1 \u2264 n \u2264 2\u22C510^5, 1 \u2264 m \u2264\
  \ n) \u2014 the length of the given sequence and the required value of the median.\n\
  \nThe second line contains a permutation p_1, p_2, ..., p_n (1 \u2264 p_i \u2264\
  \ n). Each integer between 1 and n occurs in p exactly once.\n\nOutput\n\nPrint\
  \ the required number.\n\nExamples\n\nInput\n\n5 4\n2 4 5 3 1\n\n\nOutput\n\n4\n\
  \n\nInput\n\n5 5\n1 2 3 4 5\n\n\nOutput\n\n1\n\n\nInput\n\n15 8\n1 15 2 14 3 13\
  \ 4 8 12 5 11 6 10 7 9\n\n\nOutput\n\n48\n\nNote\n\nIn the first example, the suitable\
  \ pairs of indices are: (1, 3), (2, 2), (2, 3) and (2, 4).\nA: ```n, m = map(int,\
  \ input().split(' '))\naa = list(map(int, input().split(' ')))\n\ndef countMoreLess(vs,\
  \ value):\n    #print(vs)\n    cur = 0\n    res = { cur: 1 }\n\n    for v in vs:\n\
  \        cur += 1 if v > value else -1\n        res[cur] = res.get(cur, 0) + 1\n\
  \    #print(res)\n    return res\n\npos = aa.index(m)\n\nleftCounts = countMoreLess(list(reversed(aa[0:pos])),\
  \ m)\nrightCounts = countMoreLess(aa[pos+1:], m)\n\nres = 0\nfor dif, count in leftCounts.items():\n\
  \    res += count * rightCounts.get(-dif, 0)\n    res += count * rightCounts.get(-dif+1,\
  \ 0)\n\nprint(res)```\nQ: Write python code to solve the following coding problem\
  \ that obeys the constraints and passes the example test cases. The output code\
  \ needs to read from and write to standard IO. Please wrap your code answer using\
  \ ```:\nKuzya started going to school. He was given math homework in which he was\
  \ given an array a of length n and an array of symbols b of length n, consisting\
  \ of symbols '*' and '/'.\n\nLet's denote a path of calculations for a segment [l;\
  \ r] (1 \u2264 l \u2264 r \u2264 n) in the following way: \n\n  * Let x=1 initially.\
  \ For every i from l to r we will consequently do the following: if b_i= '*', x=x*a_i,\
  \ and if b_i= '/', then x=(x)/(a_i). Let's call a path of calculations for the segment\
  \ [l; r] a list of all x that we got during the calculations (the number of them\
  \ is exactly r - l + 1). \n\n\n\nFor example, let a=[7, 12, 3, 5, 4, 10, 9], b=[/,\
  \ *, /, /, /, *, *], l=2, r=6, then the path of calculations for that segment is\
  \ [12, 4, 0.8, 0.2, 2].\n\nLet's call a segment [l;r] simple if the path of calculations\
  \ for it contains only integer numbers. \n\nKuzya needs to find the number of simple\
  \ segments [l;r] (1 \u2264 l \u2264 r \u2264 n). Since he obviously has no time\
  \ and no interest to do the calculations for each option, he asked you to write\
  \ a program to get to find that number!\n\nInput\n\nThe first line contains a single\
  \ integer n (2 \u2264 n \u2264 10^6).\n\nThe second line contains n integers a_1,\
  \ a_2, \u2026, a_n (1 \u2264 a_i \u2264 10^6).\n\nThe third line contains n symbols\
  \ without spaces between them \u2014 the array b_1, b_2 \u2026 b_n (b_i= '/' or\
  \ b_i= '*' for every 1 \u2264 i \u2264 n).\n\nOutput\n\nPrint a single integer \u2014\
  \ the number of simple segments [l;r].\n\nExamples\n\nInput\n\n\n3\n1 2 3\n*/*\n\
  \n\nOutput\n\n\n2\n\n\nInput\n\n\n7\n6 4 10 1 2 15 1\n*/*/*//\n\n\nOutput\n\n\n\
  8\nA:"
