  \ 0\n\nfor l in range(n):\n    for r in range(l, n):\n        x = 1\n        for\
  \ i in range(l, r+1):\n            if b[i-1] == '*':\n                x *= a[i]\n\
  \            else:\n                x //= a[i]\n        if x.is_integer():\n   \
  \         count += 1\n\nprint(count)```\nQ:"
