  \          path.append(path[-1] * a[k])\n        else:\n            path.append(path[-1]\
  \ // a[k])\n    return path\n\ndef is_integer(lst):\n    return all(x.is_integer()\
  \ for x in lst)\n\ncount = 0\nfor i in range(n):\n    for j in range(i, n):\n  \
  \      if is_integer(calc_path(i, j)):\n            count += 1\n\nprint(count)```\n\
